import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx"
import Note from "./Notes.jsx";
import notes from "../Note.js";



function App(){
    return <div>
    <Header />

    {notes.map(note => <Note 
        id = {note.key}
        key = {note.key}
        title = {note.title}
        content = {note.content}
    />)}
    
    <Footer />
</div>   
}

export default App;
